import React from "react";
import styled from "styled-components";

const InforPerfil = ({ content, onClick }) => (
  <Container>
    <BoxOne>
      <span></span>
      <div>
        <img src="/assets/account.svg" />
      </div>
      <title>Rick Bone Junior</title>
      <h4>@rickbonejr</h4>
      <section>
        <p>Seguidores</p>
        <p>109</p>
      </section>
      <section>
        <p>Seguindo</p>
        <p>56</p>
      </section>
      <section>
        <p>Favoritos</p>
        <p>8</p>
      </section>
    </BoxOne>
  </Container>
);

const Container = styled.div`
  background-color: #fff;
`;
const BoxOne = styled.div`
  background-color: red;
  span {
    width: 100%;
    height: 100px;
    background: black;
    display: flex;
  }
`;

export default InforPerfil;
